					["Remarks"] = "自动冲锋/拦截敌方目标",
					["id"] = "81412688792-13634.824",
					["Macro"] = "--自动冲锋拦截\nif not Wudi and BeeIsRun(\"拦截\",\"target\") then\n    BeeRun(\"拦截\",\"target\");\n    return true;\nelseif not Wudi and BeeIsRun(\"冲锋\",\"target\") and ((BeeSpellCD(\"拦截\")>0 and BeeSpellCD(\"拦截\")<28) or (BeeUnitMana()<7)) then\n    BeeRun(\"冲锋\",\"target\");\n    return true;\nend",
					["Texture"] = "Interface\\Icons\\Spell_Shaman_GiftEarthmother",
				}, -- [8]
				{
					["type"] = "script",
					["name"] = "自动嘲讽",
					["Remarks"] = "自动嘲讽不属于自己的目标",
					["id"] = "91412688792-13634.824",
					["Macro"] = "--嘲讽\nif not BeeTargetTargetIsPlayer() and BeeIsRun(\"嘲讽\") and BeeUnitName(\"targettarget\") then\n    BeeRun(\"嘲讽\");\n    return;\nend",
					["Texture"] = "Interface\\Icons\\Ability_Hunter_Camouflage",
				}, -- [9]
				{
					["type"] = "script",
					["name"] = "乘胜追击",
					["Remarks"] = "當滿足條件時自動施放",
					["id"] = "101412688792-13634.824",
					["Macro"] = "--乘胜追击\nif BeeIsRun(\"乘胜追击\") then\n    BeeRun(\"乘胜追击\")\n    return;\nend",
					["Texture"] = "Interface\\Icons\\SPELL_SHADOW_TWISTEDFAITH",
				}, -- [10]
				{
					["type"] = "script",
					["name"] = "撕裂",
					["Remarks"] = "當滿足條件時自動施放",
					["id"] = "111412688792-13634.824",
					["Macro"] = "--撕裂\nif BeeUnitBuff(\"撕裂\",\"target\",2,0)<2 and not BeeStringFind(\"圣盾术,保护之手,寒冰屏障,圣佑术,暗影斗篷\",BeeUnitBuffList(\"target\")) and BeeIsRun(\"撕裂\") then\n    BeeRun(\"撕裂\");\n    return;\nend",
					["Texture"] = "Interface\\Icons\\Spell_Shadow_ShadeTrueSight",
				}, -- [11]
				{
					["type"] = "script",
					["name"] = "雷霆一击",
					["Remarks"] = "當滿足條件時自動施放",
					["id"] = "121412688792-13634.824",
					["Macro"] = "if BeeUnitAffectingCombat() and BeeRange(\"target\")<=8 and BeeIsRun(\"雷霆一击\") then\n    BeeRun(\"雷霆一击\")\n    return;\nend",
					["Texture"] = "Interface\\Icons\\Spell_unused2",
				}, -- [12]
				{
					["type"] = "script",
					["name"] = "震荡波",
					["Remarks"] = "自动释放着震荡波",
					["id"] = "131412688792-13634.824",
					["Macro"] = "if BeeUnitAffectingCombat() and BeeRange(\"target\")<=8 and BeeIsRun(\"震荡波\") then\n    BeeRun(\"震荡波\")\n    return;\nend",
					["Texture"] = "Interface\\Icons\\spell_Warlock_Soulburn",
				}, -- [13]
