					["Macro"] = "local bufflist = BeeUnitBuffList(\"player\")\n\nif UnitHealth(\"player\")/UnitHealthMax(\"player\")<0.75 and BeeIsRun(\"乘胜追击\") then\n    BeeRun(\"乘胜追击\");\n    return;\nend\n\nif BeePlayerBuffTime(\"激怒\")<0 and BeeIsRun(\"狂暴之怒\") then\n    BeeRun(\"狂暴之怒\");\n    return;\nend\n\nif BeeUnitAffectingCombat() and (BeeUnitMana()>70 or BeeStringFind(\"战斗专注\",BeeUnitBuffList(\"player\")) or BeeStringFind(\"激动\",BeeUnitBuffList(\"player\")) or (BeeStringFind(\"怒火中烧\",BeeUnitBuffList(\"player\")) and BeeUnitMana()>60 and BeeSpellCD(\"巨人打击\")>3)) and BeeIsRun(\"英勇打击\") then\n    BeeRun(\"英勇打击\");\n    return;\nend\n\nif BeeUnitBuff(\"行刑者\",\"player\",0,1)>=2 and  BeeUnitBuffCount(\"行刑者\",\"player\",0,1)>=5 and BeeIsRun(\"嗜血\") then\n    BeeRun(\"嗜血\");\n    return;\nend\n\nif BeeUnitBuff(\"行刑者\",\"player\",0,1)>=2 and  BeeUnitBuffCount(\"行刑者\",\"player\",0,1)>=5 and BeeIsRun(\"怒击\") then\n    BeeRun(\"怒击\");\n    return;\nend\n\nif BeeUnitBuff(\"行刑者\",\"player\",0,1)>=2 and  BeeUnitBuffCount(\"行刑者\",\"player\",0,1)>=5 and BeeIsRun(\"猛击\") then\n    BeeRun(\"猛击\");\n    return;\nend\n\nif BeeIsRun(\"斩杀\") then\n    BeeRun(\"斩杀\");\n    return;\nend\n\nif BeeIsRun(\"战斗怒吼\") then\n    BeeRun(\"战斗怒吼\");\n    return;\nend\n\nif BeeTargetDeBuffTime(\"巨人打击\")<1 and BeeIsRun(\"巨人打击\",\"target\") then\n    BeeRun(\"巨人打击\",\"target\");\n    return;\nend\n\nif BeeIsRun(\"嗜血\") then\n    BeeRun(\"嗜血\");\n    return;\nend\n\nif BeePlayerBuffTime(\"血脉贲张\")>0 and BeeIsRun(\"猛击\") then\n    BeeRun(\"猛击\");\n    return;\nend\n\nif BeeIsRun(\"怒击\") then\n    BeeRun(\"怒击\");\n    return;\nend",
